  return (
    <div className="App">
      <HeaderComponent/>
      <header className="App-header">
       <NestedFunction/>
       <hr style={{ width: "80%", border: "1px solid white", margin: "20px 0" }} />
       <ColourListComponent/>
       <hr style={{width:"80%", border:"1px solid white", margin:"20px 0" }}/>
       <h2>Conditional Statement Example</h2>
       <ConditionalStatement/>
      </header>
    </div>

  );
}

export default App;
